import PipeStatusBox from "../components/pipeStatusBox"

function mainPage() {
    return (
        <div>
            <NavBar />
            <div class="max-w-screen-sm mx-auto flex flex-col gap-2 p-4">
                <PipeStatusBox />
                <PipeStatusBox />
                <PipeStatusBox />
            </div>
            
        </div>
        
        
        );
}

export default mainPage;
